import React from "react";
import "./Jumbotron.css";

function Jumbotron({ props }) {
  return (
    <div
      style={{ height: 300, 
                clear: "both", 
                paddingTop: 120, 
                textAlign: "center",
                backgroundImage: 'url("https://png.pngtree.com/thumb_back/fw800/back_pic/00/13/10/6156433899a0cfd.jpg")'
              }}

      className="jumbotron"
    >
      {props.children}
    </div>
  );
}

export default Jumbotron;
